import React from "react";

function Footer() {
  return (
    <div className="footer-main">
      <div className="wrap">
        <div className="subject-footer">
          <h4>ABOUT WPKUBE</h4>
        </div>
        <div className="links-footer">
          <h4>USEFUL LINKS</h4>
        </div>
        <div className="reviews-footer">
          <h4>REVIEWS</h4>
        </div>
        <div className="deals-footer">
          <h4>DEALS</h4>
        </div>
      </div>
    </div>
  );
}

export default Footer;
